import React from 'react';
import './Home.css';

function Home() {
    return (
        <section class="home">

            <div class="textes">
                <h2>Plongeons, observons <br></br>et r√©agissons pour l'avenir.</h2>
                <p>Plongez au sein de notre exposition immersive et ambulante qui sensibilise sur l'exploitation des ressources marines.</p>
            </div>

            <img class="home_image" src="plongeur.gif" alt="Plongeur" />
            <img class="home_image_tortue" src="tortue.png" alt="Tortue" />
            <img class="home_image_coreaux" src="coreaux.png" alt="Coreaux" />
        </section>
    );
}

export default Home;
